import './App.css';
import {BrowserRouter, Route, Routes } from "react-router-dom";
import Cursos from "./components/cursos/index.js";
import CrearCurso from "./components/crearCurso";
import Detalle from "./components/detalle";


function App() {
  return (

    <div className="App">
    <Routes>
        <Route path = "/" component = {Cursos}/>
        <Route path= "/:id" component = {Detalle}/>
        <Route exact path = "/crear" component = {CrearCurso}/>
    </Routes>

    </div>

  );
}

export default App;
